    render() {
        return (
            <div className="TodoApp" >
                Todo Application
            </div>
        )
    }
}

class LoginComponent extends Component {
    render() {
        return (
            <div>
                User Name : <input type="text" name="username" ></input>
                Password : <input type="password" name="password"></input>
                <button>Login</button>
            </div>

            );
    }
}
export default TodoApp;
